import React from "react";
import PutitoService from "../../services/PutitoService";

class PutitoComponent extends React.Component {

    constructor(props){
        super(props)
        this.state = {
            putito:[]
        }
    }

    componentDidMount(){
        PutitoService.getputito().then((Response) => {
            this.setState({putito: Response.data})
        });
    }}

    export default PutitoComponent
